import React from 'react'
import Card from '@material-ui/core/Card';
import Paper from '@material-ui/Paper';
import { makeStyles } from '@material-ui/core/styles';
import CardContent from '@material-ui/core/CardContent';
import Typography from '@material-ui/core/Typography';
const useStyles = makeStyles((theme) => ({
    root: {
      display: 'flex',
      flexWrap: 'wrap',
      margin: '10px',
      overflow: 'hidden',
      backgroundColor: theme.palette.background.paper,
    },
    gridList: {
      width: 500,
      height: 450,
    },
    paper: {
      padding: theme.spacing(2),
      textAlign: 'center',
      color: theme.palette.text.secondary,
    },
    bullet: {
      display: 'inline-block',
      margin: '0 2px',
      transform: 'scale(0.8)',
    },
    title: {
      fontSize: 14,
    },
    pos: {
      marginBottom: 12,
      textAlign: 'center',
      fontWeight: 600
    },
    row: {
      width: '97%'
    },
    cardContent: {
      width: '100%',
      textAlign: 'center',
      backgroundColor: 'lightblue',
    },
  }));

  const Cardwrap = ({text,value}) => {
    const classes = useStyles();
      return (    
      <div className={classes.root}>
        <div className={classes.row}>
          <Card className={classes.root} variant="outlined">
            <CardContent className={classes.cardContent}>
              <Typography variant="h5" component="h2">
                {text}
           </Typography>
              <Typography className={classes.pos} color="textSecondary">
                  {value}
              </Typography>
            </CardContent>
          </Card>
        </div>
      <div style={{marginTop: 1 + 'em'}}>
      <Paper zDepth={3} style={this.style}>
      <div style={{display:'inline-block'}}>
        <div>Expense 1</div>
        <div>
        <DateIcon  color={grey500} style={{height:'10px',width:'auto'}}></DateIcon>
        <span style={{color:'grey',fontSize:'11px',paddingLeft:'2px'}}><i>10,September 2017</i></span>
        </div>
        </div>
        <div style={{float:'right',paddingRight:'50px',color:'rgb(105, 164, 226)'}}>
        500
        </div>
      </Paper>
          </div>
          </div>     
      )
  }
  export default Cardwrap;
